import React, { Component } from 'react';
import ViewObject from "../../util/ViewObject";
import TableCell from "@mui/material/TableCell";
import TableRow from "@mui/material/TableRow";
import {JSONtoStringifyYAML} from "../../util/util";

class Dataset extends Component {
    constructor(props) {
        super(props);
        this.state = {
            name: this.props.name,

            configJSON: this.props.originalJSON['dataset-config'],
            statusJSON: this.props.originalJSON['status'],
        };
    }

    render() {
        const {name, configJSON, statusJSON} = this.state
        const {handleSendRequest} = this.props

        return (
            <TableRow
                key={name}
                sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
            >
                <TableCell component="th" scope="row">{name}</TableCell>
                <TableCell align="right">{statusJSON.phase}</TableCell>
                <TableCell align="right">{statusJSON.boundedAlluxioCluster || '-'}</TableCell>
                <TableCell align="right">
                    <ViewObject
                        objectKind='Dataset'
                        objectName={name}
                        objectConfigString={JSONtoStringifyYAML(configJSON)}
                        objectStatusString={JSONtoStringifyYAML(statusJSON)}
                        handleSendRequest={handleSendRequest}
                    />
                </TableCell>
            </TableRow>
        );
    }
}

export default Dataset
